import React, {useState} from 'react';

function TodoList(props) {

    const [count, setCount] = useState(0);


    return (
        <div>
            Hello World {props.name}
            <span>{count}</span>
            <button onClick={() => setCount(count + 1)}>increment</button>
        </div>
    )
}

export default TodoList;
